import './AuthForm.css';

function AuthForm() {

  return (
    <>
    <div>
    <h2>LOGIN</h2>
    <p>Please Enter your Email and Password!</p>

      <form>

        <div>
          <input type='email'/>
          <label>Email</label>
        </div>

        <div>
          <input type='password'/>
          <label>Password</label>
        </div>

        
      </form>
      </div>
    </>
  );
}

export default AuthForm;
